import React from 'react';
import './App.css';
import SlideOne from './slides/SlideOne';
const logo = require('./appOne.png');

function App() {
  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
    </div>
  );
}

export default App;
